import React, { useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./AngajatPage.css";
import navbar from "../NavbarComponent/Navbar.js";
import { Button, Modal } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import { useLocation } from "react-router-dom";

function AdminPage() {
  const location = useLocation();
  const { numeAngajat, prenumeAngajat, departamentAngajat } =
    location.state || {};
  const navigate = useNavigate();
  const [show, setShow] = useState(false);
  const [data, setData] = useState([]);
  const [showUpdateModal, setShowUpdateModal] = useState(false);

  const [updateData, setUpdateData] = useState({
    age: 0,
    sex: "",
    bmi: 0,
    children: 0,
    smoker: "",
    region: "",
    charges: 0,
  });

  const [formData, setFormData] = useState({
    age: 0,
    sex: "",
    bmi: 0,
    children: 0,
    smoker: "",
    region: "",
    charges: 0,
  });

  const handleClose = () => {
    setShow(false);
    setFormData({
      age: 0,
      sex: "",
      bmi: 0,
      children: 0,
      smoker: "",
      region: "",
      charges: 0,
    });
  };

  const [deleteCnp, setDeleteCnp] = useState(""); // CNP to delete
  const [showDeleteConfirmation, setShowDeleteConfirmation] = useState(false);
  const [searchCNP, setSearchCNP] = useState(""); // State variable for the search input
  const [searchSalariu, setSearchSalariu] = useState(""); // State variable for the search input

  const handleShow = () => setShow(true);

  const handleSearchCNPInputChange = (e) => {
    setSearchCNP(e.target.value);
  };

  const handleSearchSalariuInputChange = (e) => {
    setSearchSalariu(e.target.value);
  };

  let filteredData;

  if (searchCNP) {
    filteredData = data.filter((employee) => employee.cnp.includes(searchCNP));
  } else if (searchSalariu) {
    const salaryFilterValue = parseFloat(searchSalariu);
    filteredData = data.filter(
      (employee) => employee.salariu <= salaryFilterValue
    );
  } else {
    filteredData = data;
  }

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Make a POST request to your API endpoint
    fetch("http://localhost:5036/api/DateCompleteAngajat", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    })
      .then((response) => {
        if (response.ok) {
          // Refresh the employee list after successful POST
          fetch("http://localhost:5036/api/DateCompleteAngajat")
            .then((response) => response.json())
            .then((updatedData) => {
              setData(updatedData);
              handleClose();
            })
            .catch((error) =>
              console.error("Error fetching updated data:", error)
            );
        } else {
          // Handle errors here
        }
      })
      .catch((error) => console.error("Error making POST request:", error));
  };

  useEffect(() => {
    fetch("http://localhost:5139/api/IoTLinearRegressionApi")
      .then((response) => response.json())
      .then((data) => setData(data))
      .catch((error) => console.error("Error fetching data:", error));
  }, []);

  const handleDeleteConfirmation = (cnp) => {
    setDeleteCnp(cnp);
    setShowDeleteConfirmation(true);
  };

  const handleOpenUpdateModal = (angajatData) => {
    setShowUpdateModal(true);
    setUpdateData(angajatData);
  };

  const handleDelete = () => {
    fetch(`http://localhost:5036/api/DateCompleteAngajat/${deleteCnp}`, {
      method: "DELETE",
    })
      .then((response) => {
        if (response.ok) {
          fetch("http://localhost:5036/api/DateCompleteAngajat")
            .then((response) => response.json())
            .then((updatedData) => setData(updatedData))
            .catch((error) =>
              console.error("Error fetching updated data:", error)
            );
          setShowDeleteConfirmation(false); // Close the delete confirmation modal
        } else {
          // Handle errors here
          console.error("Error deleting employee with CNP:", deleteCnp);
        }
      })
      .catch((error) => console.error("Error making DELETE request:", error));
  };

  const handleUpdate = (e) => {
    e.preventDefault();

    fetch(
      `http://localhost:5036/api/Login/UpdateDateGeneraleAngajat/${updateData.cnp}`,
      {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(updateData),
      }
    )
      .then((response) => {
        if (response.ok) {
          fetch("http://localhost:5036/api/DateCompleteAngajat")
            .then((response) => response.json())
            .then((updatedData) => {
              setData(updatedData);
              setShowUpdateModal(false);
            })
            .catch((error) =>
              console.error("Error fetching updated data:", error)
            );
        } else {
          console.error("Error updating employee with CNP:", updateData.cnp);
        }
      })
      .catch((error) => console.error("Error making PUT request:", error));
  };

  return (
    <div>
      <nav id="navbar">
        <div className="wrapper">
          <div className="logo">
            {departamentAngajat === "Management" && (
              <a
                href="/adminHomePage"
                onClick={(e) => {
                  e.preventDefault();
                  navigate("/adminHomePage", {
                    state: {
                      numeAngajat: numeAngajat,
                      prenumeAngajat: prenumeAngajat,
                      departamentAngajat: departamentAngajat,
                    },
                  });
                }}
              >
                <img
                  src="https://logos-world.net/wp-content/uploads/2022/07/Hertz-Logo.png"
                  alt="Hertz Logo"
                  style={{ maxWidth: "100px", maxHeight: "50px" }}
                />
              </a>
            )}

            {departamentAngajat === "Contabilitate" && (
              <a
                href="/contabilitateHomePage"
                onClick={(e) => {
                  e.preventDefault();
                  navigate("/contabilitateHomePage", {
                    state: {
                      numeAngajat: numeAngajat,
                      prenumeAngajat: prenumeAngajat,
                      departamentAngajat: departamentAngajat,
                    },
                  });
                }}
              >
                <img
                  src="https://logos-world.net/wp-content/uploads/2022/07/Hertz-Logo.png"
                  alt="Hertz Logo"
                  style={{ maxWidth: "100px", maxHeight: "50px" }}
                />
              </a>
            )}
          </div>
          <span className="welcome-label">
            LinearRegression - IoT Project Frontend Example
          </span>
          <input type="radio" name="slider" id="menu-btn" />
          <input type="radio" name="slider" id="close-btn" />
          <ul className="nav-links">
            <label htmlFor="close-btn" className="btn close-btn">
              <i className="fas fa-times"></i>
            </label>
            <li>
              <a href="">Employees</a>
            </li>
            {departamentAngajat === "Management" && (
              <li>
                <a
                  href="/angajatPage"
                  onClick={(e) => {
                    e.preventDefault(); // Prevent the default link behavior
                    navigate("/stocPage", {
                      state: {
                        numeAngajat: numeAngajat,
                        prenumeAngajat: prenumeAngajat,
                        departamentAngajat: departamentAngajat,
                      },
                    });
                  }}
                >
                  Stock
                </a>
              </li>
            )}
            <input type="checkbox" id="showMega" />
            <li>
              <a
                href="/angajatPage"
                onClick={(e) => {
                  e.preventDefault(); // Prevent the default link behavior
                  navigate("/providerPage", {
                    state: {
                      numeAngajat: numeAngajat,
                      prenumeAngajat: prenumeAngajat,
                      departamentAngajat: departamentAngajat,
                    },
                  });
                }}
              >
                Providers
              </a>
            </li>
            <li>
              <a className="LogoutButton">
                <i className="fas fa-sign-out-alt"></i> Log Out
              </a>
            </li>
          </ul>
          <label htmlFor="menu-btn" className="btn menu-btn">
            <i className="fas fa-bars"></i>
          </label>
        </div>
      </nav>

      <div className="container" style={{ marginTop: "160px" }}>
        <div className="crud shadow-lg p-3 mb-5 mt-5 bg-body rounded">
          <div className="row">
            <div className="col-sm-3 mt-5 mb-4 text-gred">
              <div className="search">
                <form className="form-inline">
                  <div className="mb-2">
                    <input
                      className="form-control"
                      type="search"
                      placeholder="CNP"
                      aria-label="Search"
                      value={searchCNP}
                      onChange={handleSearchCNPInputChange}
                    />
                  </div>
                  <div className="mb-2">
                    <input
                      className="form-control"
                      type="search"
                      placeholder="Salariu"
                      aria-label="Search"
                      value={searchSalariu}
                      onChange={handleSearchSalariuInputChange}
                    />
                  </div>
                </form>
              </div>
            </div>
            <div className="col-sm-3 offset-sm-2 mt-5 mb-4 text-gred">
              <h2 style={{ color: "black" }}>
                <b>Employees</b>
              </h2>
            </div>
            <div className="col-sm-3 offset-sm-1 mt-5 mb-4 text-gred">
              <Button variant="primary" onClick={handleShow}>
                Add employee
              </Button>
            </div>
          </div>
          <div className="row">
            <div className="table-responsive">
              <table className="table table-striped table-hover table-bordered custom-table">
                <thead>
                  <tr>
                    <th>Age</th>
                    <th>Sex</th>
                    <th>BMI</th>
                    <th>Children</th>
                    <th>Smoker</th>
                    <th>Region</th>
                    <th>Charges</th>
                  </tr>
                </thead>
                <tbody>
                  {filteredData.map((Input) => (
                    <tr key={Input.age}>
                      <td>{Input.sex}</td>
                      <td>{Input.bmi}</td>
                      <td>{Input.children}</td>
                      <td>{Input.smoker}</td>
                      <td>{Input.region}</td>
                      <td>{Input.charges}</td>
                      <td>
                        <a
                          className="edit"
                          title="Edit"
                          data-toggle="tooltip"
                          onClick={() => handleOpenUpdateModal(Input)}
                        >
                          <i className="material-icons">&#xE254;</i>
                        </a>
                        <a
                          className="delete"
                          title="Delete"
                          data-toggle="tooltip"
                          onClick={() => handleDeleteConfirmation(Input.sex)}
                        >
                          <i className="material-icons">&#xE872;</i>
                        </a>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>

          {/* Delete Confirmation Modal */}
          <Modal
            show={showDeleteConfirmation}
            onHide={() => setShowDeleteConfirmation(false)}
            backdrop="static"
            keyboard={false}
          >
            <Modal.Header closeButton>
              <Modal.Title>
                Are you sure you want to delete this employee record ? The
                action is irreversible.
              </Modal.Title>
            </Modal.Header>
            <Modal.Footer>
              <Button
                variant="secondary"
                className="btn-modal"
                onClick={() => setShowDeleteConfirmation(false)}
              >
                Cancel
              </Button>
              <Button variant="danger" onClick={handleDelete}>
                Yes
              </Button>
            </Modal.Footer>
          </Modal>
        </div>

        <div>
          {/* Update Modal */}
          <Modal
            show={showUpdateModal}
            onHide={() => setShowUpdateModal(false)}
            backdrop="static"
            keyboard={false}
          >
            <Modal.Header closeButton>
              <Modal.Title>Update employee data</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <form onSubmit={handleUpdate}>
                <div className="form-group">
                  <label htmlFor="age">Age:</label>
                  <input
                    type="number"
                    className="form-control"
                    id="age"
                    name="age"
                    value={updateData.age}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, age: e.target.value })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="sex">Sex:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="sex"
                    name="sex"
                    value={updateData.sex}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, sex: e.target.value })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="pozitie">Position:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="pozitie"
                    name="pozitie"
                    value={updateData.pozitie}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, pozitie: e.target.value })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="departament">Departament:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="departament"
                    name="departament"
                    value={updateData.departament}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        departament: e.target.value,
                      })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="salariu">Salary:</label>
                  <input
                    type="number"
                    className="form-control"
                    id="salariu"
                    name="salariu"
                    value={updateData.salariu}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, salariu: e.target.value })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="nivelStudii">Educational level:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="nivelStudii"
                    name="nivelStudii"
                    value={updateData.nivelStudii}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        nivelStudii: e.target.value,
                      })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="username">Username:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="username"
                    name="username"
                    value={updateData.username}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, username: e.target.value })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="Password">Password:</label>
                  <input
                    type="text"
                    className="form-control"
                    id="password"
                    name="Password"
                    value={updateData.password}
                    onChange={(e) =>
                      setUpdateData({ ...updateData, password: e.target.value })
                    }
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="isAdmin">Management:</label>
                  <input
                    type="checkbox"
                    className="form-check-input"
                    id="isAdmin"
                    name="isAdmin"
                    checked={updateData.isAdmin}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        isAdmin: e.target.checked,
                      })
                    }
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="isAgentVanzari">Sales:</label>
                  <input
                    type="checkbox"
                    className="form-check-input"
                    id="isAgentVanzari"
                    name="isAgentVanzari"
                    checked={updateData.isAgentVanzari}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        isAgentVanzari: e.target.checked,
                      })
                    }
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="isContabil">Accountancy:</label>
                  <input
                    type="checkbox"
                    className="form-check-input"
                    id="isContabil"
                    name="isContabil"
                    checked={updateData.isContabil}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        isContabil: e.target.checked,
                      })
                    }
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="isLucratorService">Service:</label>
                  <input
                    type="checkbox"
                    className="form-check-input"
                    id="isLucratorService"
                    name="isLucratorService"
                    checked={updateData.isLucratorService}
                    onChange={(e) =>
                      setUpdateData({
                        ...updateData,
                        isLucratorService: e.target.checked,
                      })
                    }
                  />
                </div>

                <button type="submit" className="btn btn-success mt-4">
                  Update
                </button>
              </form>
            </Modal.Body>
            <Modal.Footer>
              <Button
                variant="secondary"
                onClick={() => setShowUpdateModal(false)}
              >
                Cancel
              </Button>
            </Modal.Footer>
          </Modal>
        </div>

        {/* <!-- Model Box --> */}
        <div className="model_box">
          <Modal
            show={show}
            onHide={handleClose}
            backdrop="static"
            keyboard={false}
          >
            <Modal.Header closeButton>
              <Modal.Title>Add employee</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <form onSubmit={handleSubmit}>
                <div className="form-group">
                  <input
                    type="text"
                    className="form-control"
                    name="nume"
                    value={formData.nume}
                    onChange={handleChange}
                    placeholder="First name"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="prenume"
                    value={formData.prenume}
                    onChange={handleChange}
                    placeholder="Surname"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="pozitie"
                    value={formData.pozitie}
                    onChange={handleChange}
                    placeholder="Position"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="departament"
                    value={formData.departament}
                    onChange={handleChange}
                    placeholder="Departament"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="number"
                    className="form-control"
                    name="salariu"
                    value={formData.salariu}
                    onChange={handleChange}
                    placeholder="Salary"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="nivelStudii"
                    value={formData.nivelStudii}
                    onChange={handleChange}
                    placeholder="Educational level"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="cnp"
                    value={formData.cnp}
                    onChange={handleChange}
                    placeholder="CNP"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="text"
                    className="form-control"
                    name="username"
                    value={formData.username}
                    onChange={handleChange}
                    placeholder="Username"
                    required
                  />
                </div>
                <div className="form-group mt-3">
                  <input
                    type="password"
                    className="form-control"
                    name="password"
                    value={formData.password}
                    onChange={handleChange}
                    placeholder="Password"
                    required
                  />
                </div>
                <div className="form-check mt-3">
                  <input
                    type="checkbox"
                    className="form-check-input"
                    name="isAdmin"
                    checked={formData.isAdmin}
                    onChange={handleChange}
                  />
                  <label className="form-check-label">Management</label>
                </div>
                <div className="form-check mt-3">
                  <input
                    type="checkbox"
                    className="form-check-input"
                    name="isAgentVanzari"
                    checked={formData.isAgentVanzari}
                    onChange={handleChange}
                  />
                  <label className="form-check-label">Sales</label>
                </div>
                <div className="form-check mt-3">
                  <input
                    type="checkbox"
                    className="form-check-input"
                    name="isContabil"
                    checked={formData.isContabil}
                    onChange={handleChange}
                  />
                  <label className="form-check-label">Accountancy</label>
                </div>
                <div className="form-check mt-3">
                  <input
                    type="checkbox"
                    className="form-check-input"
                    name="isLucratorService"
                    checked={formData.isLucratorService}
                    onChange={handleChange}
                  />
                  <label className="form-check-label">Service</label>
                </div>
                <button type="submit" className="btn btn-success mt-4">
                  Add
                </button>
              </form>
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={handleClose}>
                Close
              </Button>
            </Modal.Footer>
          </Modal>
        </div>
      </div>
    </div>
  );
}

export default AdminPage;
